import React from 'react';

const Video = () => {
    return (
        <section className='video'>
            <h3 className="tertiary-title">Section 1</h3>
            <h2 className="secondary-title margin-small">Variables, printing, conditionals</h2>
            <h3 className="tertiary-title">1.1 Printing to the console</h3>
            <div className="iframe-container">
                <iframe width="80%" height='315' type="text/html" frameborder="0" allowfullscreen="" src="https://www.youtube.com/embed/gMiq50rNOlA" data-youtubeid="G4doTGQPRPw" data-translatedyoutubeid="G4doTGQPRPw" tabindex="0" allow="autoplay"></iframe>
             </div>
        </section>
    );
}

export default Video;
